import React, { useState } from "react";
import {
  View,
  Text,
  TextInput,
  TouchableOpacity,
  StyleSheet,
} from "react-native";

const Register = ({ navigation }) => {
  return (
    <View style={styles.container}>
      <Text style={styles.text}>Register Page</Text>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    height: 200,
    width: 200,
    flex: 1,
    alignItems: "center",
    justifyContent: "center",
    borderWidth: 2,
  },
  text: {
    justifyContent: "center",
    fontSize: 30
  }
});

export default Register;
